query.sparql:
PREFIX wd: <http://www.wikidata.org/entity/>
    PREFIX wdt: <http://www.wikidata.org/prop/direct/>
    PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
  {
    SELECT (COUNT(?countryEurope) AS ?EuropeCount)
    WHERE {
      ?countryEurope wdt:P30 wd:Q46.
      ?countryEurope wdt:P31 wd:Q6256.
    }
  }
  {
    SELECT (COUNT(?countryAsia) AS ?AsiaCount)
    WHERE {
      ?countryAsia wdt:P30 wd:Q48.
      ?countryAsia wdt:P31 wd:Q6256.
    }
  }
  FILTER (?EuropeCount > ?AsiaCount)
}

PREFIX wd: <http://www.wikidata.org/entity/>
    PREFIX wdt: <http://www.wikidata.org/prop/direct/>
    PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
  {
    SELECT ?director1 WHERE {
      wd:Q696928 wdt:P57 ?director1 .
    }
  }
  {
    SELECT ?director2 WHERE {
      wd:Q951002 wdt:P57 ?director2 .
    }
  }
  FILTER (?director1 != ?director2)
}

PREFIX wd: <http://www.wikidata.org/entity/>
    PREFIX wdt: <http://www.wikidata.org/prop/direct/>
    PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?danielCount ?paulCount WHERE {
  {
    SELECT (COUNT(?film1) AS ?danielCount) WHERE {
      ?film1 wdt:P161 wd:Q343616 .
      ?film1 wdt:P31 wd:Q11424 .
    }
  }
  {
    SELECT (COUNT(?film2) AS ?paulCount) WHERE {
      ?film2 wdt:P161 wd:Q166389 .
      ?film2 wdt:P31 wd:Q11424 .
    }
  }
  BIND(?danielCount > ?paulCount AS ?danielMore)
}

PREFIX wd: <http://www.wikidata.org/entity/>
    PREFIX wdt: <http://www.wikidata.org/prop/direct/>
    PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?winner WHERE {
  {
    SELECT (COUNT(?awardsMJ) AS ?countMJ) WHERE {
      wd:Q41421 p:P166/ps:P166 ?awardsMJ .
      ?awardsMJ wdt:P31 wd:Q25369 .
    }
  }
  {
    SELECT (COUNT(?awardsKB) AS ?countKB) WHERE {
      wd:Q484652 p:P166/ps:P166 ?awardsKB .
      ?awardsKB wdt:P31 wd:Q25369 .
    }
  }
  BIND(
    IF(?countMJ > ?countKB, "Michael Jordan", "Kobe Bean Bryant") AS ?winner
  )
}
